import React from 'react';
import { MDBContainer, MDBRow, MDBCol, MDBBreadcrumb, MDBBreadcrumbItem, MDBCard, MDBCardImage, MDBCardBody, MDBCardText } from 'mdb-react-ui-kit';

const teamMembers = [
  {
    name: 'Imashi Thakshila',
    title: 'Software Engineer',
    image: 'https://readyplayer.me/gallery/65c99fa6d87ad4b6832d002e',
    description: 'Imashi Thakshila is an experienced software engineer who specializes in building high-quality websites and applications.',
  },
  {
    name: 'Tharushi Dilshani',
    title: 'Web Developer',
    image: 'https://readyplayer.me/gallery/65c9a20ac6acb0ce8d6b967c',
    description: 'Jane has a strong background in web development and enjoys crafting user interfaces with React.',
  },
];

const AboutUs = () => {
  return (
    <MDBContainer>
      <MDBBreadcrumb>
        <MDBBreadcrumbItem>
          <a href='#'>Home</a>
        </MDBBreadcrumbItem>
        <MDBBreadcrumbItem active>About Us</MDBBreadcrumbItem>
      </MDBBreadcrumb>
      <MDBRow>
        <h2 className="about-us-header">Here are the members of our development team:</h2>
        <div className="team-members">
          {teamMembers.map((member, index) => (
            <MDBCol lg="4" className="mb-4" key={index}>
              <MDBCard>
                <MDBCardImage
                  src={member.image}
                  alt={member.name}
                  top
                  className="rounded-0"
                />
                <MDBCardBody>
                  <MDBCardText>{member.name}</MDBCardText>
                  <MDBCardText>{member.title}</MDBCardText>
                  <MDBCardText>{member.description}</MDBCardText>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          ))}
        </div>
      </MDBRow>
    </MDBContainer>
  );
}

export default AboutUs;
